import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams, useNavigate } from 'react-router-dom';
import Header from '../header';

const UpdateClient = () => {
    const { id } = useParams();
    const navigate = useNavigate();
    const [client, setClient] = useState({
        fname: '',
        lname: '',
        nic: '',
        address: '',
        district: '',
        province: '',
        phone: '',
        email: '',
        password: ''
    });

    useEffect(() => {
        const fetchClient = async () => {
            try {
                const response = await axios.get(`http://localhost:8070/client/getClient/${id}`);
                setClient(response.data.user);
            } catch (err) {
                console.error('Error fetching client data:', err);
            }
        };
        fetchClient();
    }, [id]);

    const handleChange = (e) => {
        setClient({ ...client, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await axios.put(`http://localhost:8070/client/updateClient/${id}`, client);
            navigate(`/profileClient/${id}`);
        } catch (err) {
            console.error('Error updating client data:', err);
        }
    };

    return (
        <div>
            <Header />
            <h2>Update Profile</h2>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>First Name:</label>
                    <input
                        type="text"
                        name="fname"
                        value={client.fname}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Last Name:</label>
                    <input
                        type="text"
                        name="lname"
                        value={client.lname}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>NIC:</label>
                    <input
                        type="text"
                        name="nic"
                        value={client.nic}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Address:</label>
                    <input
                        type="text"
                        name="address"
                        value={client.address}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>District:</label>
                    <input
                        type="text"
                        name="district"
                        value={client.district}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Province:</label>
                    <input
                        type="text"
                        name="province"
                        value={client.province}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Phone:</label>
                    <input
                        type="text"
                        name="phone"
                        value={client.phone}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Email:</label>
                    <input
                        type="email"
                        name="email"
                        value={client.email}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Password:</label>
                    <input
                        type="password"
                        name="password"
                        value={client.password}
                        onChange={handleChange}
                        required
                    />
                </div>
                <button type="submit">Update Profile</button>
            </form>
        </div>
    );
};

export default UpdateClient;
